INSERT INTO `plugin_translation` VALUES ('zN\I9Q-','/_\\MpXT\|\\','Devert | PDF Export: Shopping cart, listing, product page','Devert | PDF Export: Shopping cart, listing, product page','https://devert.net','https://devert.net','{\"1.0.5\":[\"Bugfix in migration script\",\"Non-printable characters are removed (Wrong character for currency)\"],\"1.0.4\":[\"Compatibility with 6.4.0.0\"],\"1.0.3\":[\"Product PDF: Fix manufacturer logo sizing\",\"Add config for custom filenames\",\"Remove links inside pdf files\",\"Add individuell offer numbers\",\"Increase font size in footer\",\"Improve cart pdf styling\",\"Improve offer pdf styling\"],\"1.0.2\":[\"Replace extends with sw_extends in twig tempaltes\"],\"1.0.1\":[\"Individual logo in the PDFs to configure (optional).\",\"Added product PDF \\/ \\\"Force description on new page?\\\" option\",\"Listing PDF \\/ distance above base price removed; base price moved below normal price\",\"Debug mode: die function removed\"],\"1.0.0\":[\"Release\"]}',NULL,'2021-10-19 11:08:48.674','2021-10-27 15:13:41.990'),('zN\I9Q-','/p\LM\4\8','Devert | PDF Export: Warenkorb, Listing, Produktseite','Devert | PDF Export: Warenkorb, Listing, Produktseite','https://devert.net','https://devert.net','{\"1.0.6\":[\"Darstellungsfehler von Tabellen in der Artikelbeschreibung behoben\"],\"1.0.5\":[\"Bugfix in Migration Script\",\"Nicht druckbaren Zeichen werden entfernt (Falsches Zeichen bei der Whrung)\"],\"1.0.4\":[\"Kompatibilitt mit 6.4.0.0\"],\"1.0.3\":[\"Produkt PDF: Darstellungsfehler Hersteller-Logo behoben\",\"Konfiguration fr individuelle Dateinamen hinzugefgt\",\"Links in PDF entfernt\",\"Angebotsnummer hinzugefgt\",\"Schriftgre im Footer erhht\",\"Darstellung der Warenkorb PDF verbessert\",\"Darstellung der Angebots PDF verbessert\"],\"1.0.2\":[\"extends mit sw_extends in Twig Tempaltes getauscht\"],\"1.0.1\":[\"Individuelles Logo in den PDFs zum konfigurieren (optional)\",\"Produkt PDF \\/ Option \\\"Beschreibung auf neuer Seite erzwingen?\\\" hinzugefgt\",\"Listing PDF \\/ Abstand ber Grundpreis entfernt; Grundpreis unter normalen Preis verschoben\",\"Debug Modus: die-Funktion entfernt\"],\"1.0.0\":[\"Release\"]}',NULL,'2021-10-19 11:08:48.674','2021-10-27 15:13:41.990');
